$_MODULE['<{ets_affiliatemarketing}prestashop>defines_d015964931b30fb9ab1699941561f531'] = 'Isso é para limitar o número de pedidos que os patrocinadores ganharão recompensas, limitando o número de amigos patrocinados diretos que os patrocinadores podem ganhar recompensas em seus pedidos. Quando um pedido é feito por um cliente que está fora desse limite, todos os patrocinadores (qualquer nível) não receberão recompensa. Deixe em branco se você quiser recompensar os patrocinadores quando algum dos amigos que eles patrocinaram comprar produtos de sua loja';
